jQuery(document).ready(function(){$('form.track-me input[type="text"],form.track-me input[type="password"],form.track-me select,form.track-me textarea').each(function(){var a=$(this),b=a.parents("form").attr("gaCat"),c=a.attr("gaLabel");a.bind("focus.formTracker",function(){focusTime=Date.parse(new Date)/1E3});a.bind("blur.formTracker",function(){blurTime=Date.parse(new Date)/1E3;gaValue=blurTime-focusTime;$.ga(["_trackEvent",b,"input_exit",c,gaValue])})});$('form.track-me input[type="submit"]').each(function(){var a=$(this),b=a.parents("form").attr("gaCat"),c=a.attr("gaLabel");a.bind("click",function(){$.ga(["_trackEvent",b,"submit",c])})})})